import { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";


function TelaCadastro() {

    const [nome, setNome] = useState("");
    const [email, setEmail] = useState("");
    const [senha, setSenha] = useState("");
    const [confirmação, setConfirmação] = useState("");
    const [cadastrar, setCadastras] = useState("Cadastrar");

    const servidor = "http://localhost:3000/cadastro";

    const navigate = useNavigate();


    return (
        <Container>
            <Title>MyWallet</Title>
            <Inputs>
                <Input type="text" placeholder="Nome"
                onChange={(e) => setNome(e.target.value)} value={nome}>
                </Input>
                <Input type="text" placeholder="E-mail"
                onChange={(e) => setEmail(e.target.value)} value={email}>
                </Input>
                <Input type="password" placeholder="Senha"
                  onChange={(e) => setSenha(e.target.value)} value={senha}>
                </Input>
                <Input type="password" placeholder="Confirme a senha"
                  onChange={(e) => setConfirmação(e.target.value)} value={confirmação}>
                </Input>
                <SignUp >{cadastrar}</SignUp>
            </Inputs>
            <Hiperlink>Já tem uma conta? Entre agora!</Hiperlink>

        </Container>
    )
}

const Container = styled.div`
    width: 375px;
`

const Title = styled.h1`
    font-family: 'Saira Stencil One', cursive; 
    font-size: 32px;
    text-align: center;
    color: #FFFFFF;
    margin-top: 95px;
    margin-bottom: 24px;
`

const Inputs = styled.div`
    display: flex;
    flex-direction: column;
    gap: 13px;
    padding-left: 25px;
`
const Input = styled.input`
        width: 326px;
        height: 58px;
        border-radius: 5px;
        padding-left: 15px;
`
const SignUp = styled.button`
    font-size: 20px;
    font-weight: 700;
    color: #FFFFFF;
    width: 326px;
    height: 46px;
    border-radius: 5px;
    background-color: var(--cor-botao);
`
const Hiperlink = styled.p`
    font-size: 15px;
    font-weight: 700;
    text-align: center;
    color: #FFFFFF;
    margin-top: 36px;
`
export default TelaCadastro;
